import { React, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { useLocation } from 'react-router-dom';
import { toast } from 'react-toastify';

const PartnerDashboard = () => {

    const { restaurant, restaurants, user } = useSelector(state => ({ ...state }));
    const [restaurantDet, setRestaurantDet] = useState(restaurant || '');
    const location = useLocation();

    useEffect(() => {
        if (!restaurant) {
            let params = location.pathname.split('/');
            setRestaurantDet(restaurants?.filter(rest => rest._id === params[2])[0]);
        }
    }, [restaurant, restaurants, user])

    const handleRestaurantStatus = (status) => {
        modifyRestaurantStatus(user.token, restaurantDet._id, status)
            .then(res => {
                if(res.status === 200) {
                    toast.success(res.status.message);
                } else {
                    toast.error(res.status.message);
                }
            })
            .catch(error => toast.error(error))
    }

    return (
        <div className='container-fluid my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-8 col-10 offset-lg-2 offset-1 p-md-4 p-3 text-center shadow'>
                    <h3 className='text-center'>{restaurantDet?.restaurantName}</h3>
                    <div className='row p-5'>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Contact:</label>
                            <span className='ps-2'>
                                {restaurantDet?.contact}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Email:</label>
                            <span className='ps-2'>
                                {restaurantDet?.email}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Address:</label>
                            <span className='ps-2'>
                                {restaurantDet?.restaurantAddress}, {restaurantDet?.city}, {restaurantDet?.state}, {restaurantDet?.zipCode}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Status:</label>
                            <span className='ps-2'>
                                {restaurantDet?.status}
                            </span>
                        </div>
                        <div className='col-12 border-top border-3 text-center my-3 pt-3'>
                            <h4>Owner Details</h4>
                        </div>

                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>First Name:</label>
                            <span className='ps-2'>
                                {restaurantDet?.firstName}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Last Name:</label>
                            <span className='ps-2'>
                                {restaurantDet?.lastName}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Type:</label>
                            <span className='ps-2'>
                                {restaurantDet?.establishmentType}
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Outlet Type:</label>
                            <span className='ps-2'>
                                {
                                    restaurantDet?.outletType?.map(outlet => outlet.toLowerCase())?.join(', ')
                                }
                            </span>
                        </div>
                        <div className='col-lg-6 col-12 text-start'>
                            <label className='col-form-label text-start fw-bold fs-6'>Cuisines Type:</label>
                            <span className='ps-2'>
                                {
                                    restaurantDet?.cuisinesType?.map(cuisine => cuisine.toLowerCase())?.join(', ')
                                }
                            </span>
                        </div>
                        {
                            user?.role === 'admin' && <div className='col-12 mt-3 text-center'>
                                <ul className='list-group flex-row justify-content-center'>
                                    <li className='list-group-item border-0 bg-transparent'>
                                        <button className='btn btn-filled' onSubmit={() => handleRestaurantStatus('Accepted')}>Accept</button>
                                    </li>
                                    <li className='list-group-item border-0 bg-transparent'>
                                        <button className='btn btn-hollow'  onSubmit={() => handleRestaurantStatus('Declined')}>Decline</button>
                                    </li>
                                </ul>
                            </div>
                        }
                    </div>
                </div>
            </div>
        </div>
    )
}

export default PartnerDashboard;
